import React from "react";

export const Tile = ({name, username, email, id}) => {
  return (
    <div className="tile-container">
      <div className="tile">
      <h2>{id}</h2>
      <h2>{name}</h2>
      <p>{username}</p>
      <p>{email}</p>
    </div>
    </div>
  );
};
